    const panel = document.getElementById("cmm-panel-contact") as HTMLElement;
    const closeBtn = document.getElementById("cmm-close-contact") as HTMLElement;

    let isOpen = false;
    const open = () => { isOpen = true; backdrop.style.opacity = "1"; backdrop.style.pointerEvents = "auto"; panel.style.transform = "translateX(0)"; };
    const close = () => { isOpen = false; backdrop.style.opacity = "0"; backdrop.style.pointerEvents = "none"; panel.style.transform = "translateX(100%)"; };
    const toggle = (e: Event) => { e.stopPropagation(); if (isOpen) { close(); } else { open(); } };

    const hamburgers = container.querySelectorAll<HTMLElement>('[data-framer-name="Mobile Menu Icon"]');
    hamburgers.forEach((icon) => { icon.style.cursor = "pointer"; icon.addEventListener("click", toggle); });
